        </div>
        <h1 className='h-done'>Success</h1>
        <p className='p-done'>Booking Confirmed</p>
        <p className='p-done'>Email has been sent to {useremail}</p>
        <button className="popup-goes" onClick={fresh} type="button">Thank You</button>
      </div>
    </div>
  );
}

export default Done;
